::root {
    --color-primary: #0B0B0B;
    --color-secondary: #1E2832;
    --font-primary: 'Roboto', sans-serif;
}

.header-wrapper {
    background: #F1F1F1;
}

body {
    font-family: var(--font-primary);
}


/* == Main Menu == */

.main-menu .navbar-nav .nav-link {
    padding: 20px 20px;
}


/* LOGO */

.logo {
    position: absolute;
    transform: translateX(-50%);
    left: 50%;
}


/* BANNER TITLE */

.brands {
    padding: 50px 0;
}

.banner {
    padding: 50px 0;
}

.banner__title {
    font-size: 74px;
    line-height: 55px;
}

.banner__discription {
    font-weight: 400;
    font-size: 30px;
    line-height: 55px;
    text-transform: capitalize;
}

.btn {
    border-radius: 0;
}


/* ===Account=== */

.account__link {
    display: inline-block;
    margin: 0 10px;
    color: var(--color-primary);
}


/*==FEATURE PRODUCT==*/

.feature-product .container {
    position: relative;
}

.feature-product-explore {
    text-transform: uppercase;
    font-family: 'Roboto';
    font-weight: 400;
    font-size: 34px;
    line-height: 40px;
    position: absolute;
    top: 45%;
    left: -300px;
    transform: rotate(-90deg);
    z-index: 1;
}


/* ===PRODUCT ITEM ===*/

.product-image {
    position: relative;
    overflow: hidden;
    margin-bottom: 23px;
}

.product-image:hover .product__info {
    bottom: 0;
}

.product__info {
    position: absolute;
    bottom: -100%;
    left: 0;
    right: 0;
    background: black;
    color: #fff;
    transition: ease-in-out 0.3s;
}

.product__name {
    font-size: 16px;
    font-weight: 600;
    text-decoration: none;
    color: #000;
}

.product-meta {
    padding: 10px 0;
}

.product__category {
    font-size: 16px;
    color: #777;
    text-decoration: none;
}

.product__price {
    font-size: 16px;
}

.product__price--old {
    text-decoration: line-through;
    margin-right: 10px;
    color: #777777
}

.product__price--new {
    color: #FF6F61;
}

.product__sale {
    position: absolute;
    top: 20px;
    left: 0;
    background: #000;
    color: #fff;
    padding: 3px 10px;
}

.product__hot {
    position: absolute;
    top: 20px;
    left: 0;
    background: red;
    color: #fff;
    padding: 3px 10px;
}


/* ==SECTION COMMON== */

.section-header {
    padding: 30px 0;
}

.section-header__title {
    font-family: 'Roboto';
    font-style: normal;
    font-weight: 500;
    font-size: 45px;
    line-height: 53px;
    text-align: center;
}


/* ==BLOCK FILTER== */

.block-filter {
    padding: 15px 0;
}

.block-filter__link {
    color: #777;
}

.block-filter__item:first-child .block-filter__link {
    padding-left: 0;
}

.block-filter__link--active {
    color: #000
}


/* ==brand-banner== */

.brand-banner {
    padding: 80px 0;
}

.brand-banner__background {
    background-image: url(./upload/collection/1.png );
}


